<p>Трубы МГК стандартные круглые с гофром высотой 50 мм предназначены для использования в системах водоотводов, дренажа, инженерных коммуникациях, устроенных под насыпями разной высоты. Условный диаметр труб 150х50 мм находится в диапазоне 1,5–8 м, что дает возможность проектировать сооружения любого требуемого размера, включая тоннельные проходы, скотопрогонные пути и другие крупные сооружения.</p>
<p>Идеально круглый профиль облегчает и упрощает расчеты — всегда можно найти идеальную по несущей способности трубу, соответствующую типу грунта насыпи и характеру основания. Круглые трубы отлично выдерживают давление грунта и воспринимают динамические и статические нагрузки на насыпь, равномерно распределяя усилия. Риск деформации при эксплуатации сооружения в проектном режиме исключен.</p>
